3	Presenta serias dificultades en una asignatura y ésta representa una problemática para llegar a la titulación.	a
4	Presenta dificultades asociadas a organización del tiempo – ausencia de hábito, estrategias, métodos de estudio.	a
5	Reprobación del ciclo básico con o sin causal de eliminación.	a
6	El estado emocional del/la estudiante Afecta notoriamente su desarrollo personal y académico.	s
7	Dificultad para lidiar con responsabilidades propias de un/a estudiante de E.S, se observa sobrecargado 	s
