9	Crisis vocacional.	s
10	Conductas emocionales: Frustración, hipersensibilidad, ansiedad, angustia, estrés académico, dificultades en la comunicación y expresión oral.	s
11	Inadecuada higiene de sueño y alimentación.\r\n	s
